"""캐글에서 열리는 타이타닉 대회의 리더보드를 보면, 우리의 점수가 상위 2% 안에 든다는 것을 알 수 있습니다. 일부 카글러들은 100% 정확도에 도달했지만, 타이타닉의 희생자들의 목록을 쉽게 찾을 수 있기 때문에, 그들의 공연에는 기계 학습이 거의 개입되지 않았을 것 같습니다!"""

