"""그러나 교차 검증 접힌 10개의 평균 정확도만 보는 것이 아니라, 각 모델에 대한 10개의 점수를 모두 표시하고, 하위 사분위와 상위 사분위를 강조하는 상자 그림과 점수의 범위를 보여주는 "수염"을 표시해 봅시다(이 시각화를 제안해 준 Nevin Yilmaz 덕분입니다). 는 boxplot()기능(라고 불리는"전단지")고가 수염에 포함하지 않는다로 분리된 것을 감지합니다. 특히, 하위 사분위가 Q1이고 상위 사분위가 Q3이면 사분위간 범위 IQR=Q3-Q1(상자 높이) 및 Q1-1.5보다 낮은 점수×IQR은 전단지, 어떤 점수 Q3+1.5×IQR보다 훨씬 크다.."""

plt.figure(figsize=(8, 4))
