"""그럼 전처리 함수를 작성해보도록 하겠습니다. 먼저 HTML을 일반 텍스트로 변환하는 기능이 필요합니다. 이렇게 하는 가장 좋은 방법은 아마도 훌륭한 BeautifulSoup 라이브러리를 사용하는 것이지만, 나는 이 프로젝트에 또 다른 의존성을 추가하는 것을 피하고 싶기 때문에 정규 표현을 사용하여 빠르고 더러운 솔루션을 해킹해 보자. 다음 함수는 먼저 <head> 섹션을 드롭한 다음 모든 <a> 태그를 하이퍼링크라는 단어로 변환한 다음 모든 HTML 태그를 제거하고 일반 텍스트만 남깁니다. 또한 가독성을 위해 여러 개의 새 줄을 단일 새 줄로 교체하고 마지막으로 html 엔티티(예: &gt; 또는 &nbsp;)를 이스케이프 해제합니다."""

import re
from html import unescape

def html_to_plain_text(html):
    text = re.sub('<head.*?>.*?</head>', '', html, flags=re.M | re.S | re.I)
    text = re.sub('<a\s.*?>', ' HYPERLINK ', text, flags=re.M | re.S | re.I)
    text = re.sub('<.*?>', '', text, flags=re.M | re.S)
    text = re.sub(r'(\s*\n)+', '\n', text, flags=re.M | re.S)
    return unescape(text)

